import { FormGroup, FormLabel, TextField, FormControlLabel, Checkbox } from "@material-ui/core";

import React from "react";


const address = () => {
    return (
        <FormGroup>
            <FormLabel>Primary Address</FormLabel>
            <div>
                <TextField
                    label="Primary"
                    helperText="101 N. First St."
                    variant="outlined"
                />
                <TextField
                    label="City"
                    helperText="Phoenix"
                    variant="outlined"
                />
                <FormControlLabel control={<Checkbox name="hs" />} label="High School" />
            </div>
        </FormGroup>
    );
}

export default address;
